import {makeAutoObservable} from "mobx";

export default class OrderStore{
    constructor() {
        this._orders = [
            {id:1, status:'Не зібрано', date:"02.12.2001"},
            {id:2, status:'Зібрано', date:"02.31.2001"},
            {id:3, status:'Відравлено', date:"02.03.2001"},
        ]
        makeAutoObservable(this)
    }

    setOrders(order){
        this._orders = order
    }

    get orders() {
        return this._orders
    }
}
